const React=require("react");

function Education(props){
    return(
        <div className="edu">
        <img className="pic2" src={props.picture}></img>
        <h4 className="heading2">{props.heading}</h4>
        <h2>{props.title}</h2>
        <p>{props.text}</p>
        <h3>{props.name}</h3>
    </div>);
}

export default Education;
